function playCallingSound() {
  const sound = new Audio(
    'data:audio/mpeg;base64,'
  )
  sound.play()
  sound.loop = true
  return sound
}
function playIncomingCallSound() {
  const sound = new Audio(
    'data:audio/mpeg;base64,'
  )
  sound.loop = true
  sound.play()
  return sound
}

export { playCallingSound, playIncomingCallSound }
